<p>\u4E0A\u62A5\u65B9\u5F0F\u4E00\u822C\u91C7\u75281px\u56FE\u7247Get\u8BF7\u6C42\uFF0C\u5C06\u6570\u636E\u653E\u5728query\u4E2D\uFF1B\u6216\u8005\u91C7\u7528 <a href="https://developer.mozilla.org/zh-CN/docs/Web/API/Navigator/sendBeacon"><code>navigator.sendBeacon</code></a>\uFF0C\u5B83\u662F\u5F02\u6B65\u7684post\u8BF7\u6C42\uFF0C\u53EF\u4EE5\u4FDD\u8BC1\u9875\u9762\u5378\u8F7D\u4E5F\u80FD\u5B8C\u6210\u4E0A\u62A5\uFF0C\u5E76\u4E14\u4E0D\u4F1A\u4E0E\u63A5\u53E3\u8BF7\u6C42\u7ADE\u4E89\uFF0C\u662F\u7406\u60F3\u7684\u4E0A\u62A5\u65B9\u5F0F</p>
